class AssociarCatalogoComponent {
    constructor(translate, catalogueService, route, messageService, router, cookieService) {
        this.translate = translate;
        this.catalogueService = catalogueService;
        this.route = route;
        this.messageService = messageService;
        this.router = router;
        this.cookieService = cookieService;
        this.selectedNode = {};
        this.style = {};
        translate.setDefaultLang('pt');
        translate.use(this.cookieService.get('locale'));
        this.style.width = '250px';
        this.selectedNode.data = {};
        this.catalogos = [];
        this.view = 'search';
    }
    ngOnInit() {
        this.idProjeto = +this.cookieService.get('idProjeto');
        this.nameProject = this.cookieService.get('projectName');
        this.files = [];
        this.cols = [
            { field: 'name', header: 'Name', type: 'type' }
        ];
        this.encontrarCatalogo();
        this.translate.get('AssociarCatalogo.Summary').subscribe((res) => {
            this.summary = res;
        });
        this.translate.get('AssociarCatalogo.Detail').subscribe((res) => {
            this.detail = res;
        });
    }
    encontrarCatalogo() {
        this.catalogueService.getAllCatalogues().subscribe((response) => {
            this.catalogos = response;
        }, (error) => {
            throw error;
        });
    }
    showInfo(catalogue) {
        this.idCatalogo = catalogue.id;
        this.view = 'info';
        this.files = [this.catalogueService.catalogueToNode(catalogue)];
        this.selectedNode.data = {};
    }
    voltar() {
        this.view = 'search';
    }
    voltarProjeto() {
        this.router.navigate(['app/projeto/informacoes']);
    }
    associar() {
        this.catalogueService.associateCatalogue(this.idProjeto, this.idCatalogo).subscribe((response) => {
            this.messageService.add({ severity: 'success', summary: this.summary, key: 'menuToast', detail: this.detail });
        }, (error) => {
            throw error;
        });
    }
}
