class EditarCasosComponent {
    constructor(catalogueService, route, messageService, router, cookieService, translate) {
        this.catalogueService = catalogueService;
        this.route = route;
        this.messageService = messageService;
        this.router = router;
        this.cookieService = cookieService;
        this.translate = translate;
        this.selectedNode = {};
        this.style = {};
        translate.setDefaultLang('pt');
        translate.use(this.cookieService.get('locale'));
        this.style.width = '250px';
        this.selectedNode.data = {};
    }
    ngOnInit() {
        this.idProjeto = +this.cookieService.get('idProjeto');
        this.nameProject = this.cookieService.get('projectName');
        this.files = [];
        this.cols = [
            { field: 'name', header: 'Name', type: 'type' }
        ];
        this.encontrarCasos();
        this.translate.get('EditarCasos.Summary').subscribe((res) => {
            this.summary = res;
        });
        this.translate.get('EditarCasos.Detail').subscribe((res) => {
            this.detail = res;
        });
    }
    save() {
        this.catalogueService.update(this.selectedNode.data.tipo, this.selectedNode.data.id, this.toDto()).subscribe((response) => {
            this.messageService.add({
                severity: 'success',
                summary: this.summary,
                key: 'menuToast',
                detail: this.detail
            });
        }, (error) => {
            throw error;
        });
    }
    encontrarCasos() {
        this.catalogueService.getReusedCases(this.idProjeto.toString()).subscribe((response) => {
            let node;
            node = {};
            node.data = {};
            node.data.name = 'TestCases';
            node.expanded = true;
            node.children = [];
            for (const test of response) {
                node.children.push(this.catalogueService.testCaseToNode(test));
            }
            this.files = this.files.concat(node);
        }, (error) => {
            throw error;
        });
    }
    toDto() {
        const testDto = { id: this.selectedNode.data.id, name: this.selectedNode.data.name, mandatory: this.selectedNode.data.mandatory, priority: this.selectedNode.data.priority, entao: this.selectedNode.data.entao, quando: this.selectedNode.data.quando, sendoQue: this.selectedNode.data.sendoQue, scenario: this.selectedNode.data.scenario, functionalRequirement: this.selectedNode.data.functionalRequirement, entries: this.selectedNode.data.entries };
        return testDto;
    }
    voltarProjeto() {
        this.router.navigate(['app/projeto/informacoes']);
    }
}
